description:
Here are the contents of a two-DVD set from Walt Disney Treasures. They show various episodes of the Disney anthology series that were set in Tomorrow Land, many of which were directed by legendary Disney animator Ward Kimball.

Covered are topics such as:
1. man's journey to outer space;
2. facts and fantasy about the moon;
3. the possibility of life on other planets;
4. weather superstitions, facts and using satellites for weather predictions;
5. the atom and nuclear fission;
6. ideas about prototype communities of the future;
7. Tomorrow Land at the Disney theme parks;
8. Walt Disney's vision of the future;
9. backround and behind-the-scenes at Disney Corporation
